      this.selectedBookIndex = (this.selectedBookIndex - 1);
      if(this.selectedBookIndex == -1){
        this.selectedBookIndex = this.books.length-1;
      }
    }
    this.changeBg.emit(this.books[this.selectedBookIndex].image);
  }


